import '../introduce/css/header.css';

function HomeWrapPage(){
    return(
        <header id="HomeWrapPage-header">
            <div>
                <ul>
                    <li><img src="web-pages/src/images/logo.png" /></li>
                    <li>이주의 공부법</li>
                    <li>플래너</li>
                    <li>커뮤니티</li>
                    <li>소개</li>
                </ul>
                <ul>
                    <li>로그인</li>
                    <li>회원가입</li>
                </ul>
            </div>
        </header>
    );
}

export default HomeWrapPage;
